import React from 'react'
import 'D:/capstone-frontend/my-app/my-app/src/App.css';
import {ImportExcelButton} from 'D:/capstone-frontend/my-app/my-app/src/components/button/ImportExcelButton';
import { Table } from '../tabledata/ComponentsTable';
import ComponentPopup from 'D:/capstone-frontend/my-app/my-app/src/components/Popups/ComponentPopup'
import { useState } from 'react'

function Materials() {
  const [addcomponentBtn, setAddcomponentBtn] = useState(false);

  const handleClick = () => {
    console.log("clicked")
    setAddcomponentBtn(true)
  }
  return (
    <>
    <ImportExcelButton 
    onclick={ handleClick()
      }>Add Component</ImportExcelButton>
    <ComponentPopup trigger={addcomponentBtn}>
      <h3>ComponentPopup</h3>
    </ComponentPopup>
    <div className='components'>
    <Table/></div></>
  )
}

export default Materials
